class Blog extends Component{

    render(){
        return(
            <div className="blog">
       <div className="container">
           <div className="col-sm-12">
<h4>RECENT NEWS</h4>
<h1>Check Our Blog <span></span>Posts</h1>
           </div>
       </div>
            </div>
        )
    }
}
export default Blog
